def dict_build(header, seq): #Builds out a dictionary by accepting the header list and seq list
    dict_seq = {} #empty dictionary
    for i in range(len(header)): #iterates through the header list and assigns keys and values
        dict_seq[header[i]] = seq[i]
    print(dict_seq)
    return dict_seq

def gc_ratio(dictionary_seq): #Accepts the built dictionary
	ofile = open("FASTA_file.txt", "w") #Opens and writes out the text file
	for key, value in dictionary_seq.items(): #iterates through dictionary key and values
		c_value = value.count("C") #calculates the c count
		g_value = value.count("G") #calculates the g count
		c_g_value = c_value + g_value #calculates the combined count
		percentage = (c_g_value/len(value))*100 #Calculates the percentage
